!function(){"use strict";document.querySelectorAll(".js-swiper1").forEach((function(e){new Swiper(e,{slidesPerView:1,spaceBetween:0,initialSlide:2,allowTouchMove:!0,grabCursor:!0,keyboard:{enabled:!0},pagination:{el:".swiper-pagination",clickable:!0,renderBullet:function(e,t){return'<span class="'+t+'">'+[82,85,87,88,89][e]+"</span>"}},on:{slideChange:function(){let e=document.querySelector(".collection__button-year");switch(this.activeIndex){case 0:e.textContent="1982";break;case 1:e.textContent="1985";break;case 2:e.textContent="1987";break;case 3:e.textContent="1988";break;case 4:e.textContent="1989";break;default:e.textContent=""}}}})}))}();